    // Click on the search input field
    await page.waitForSelector('input.search-input', { timeout: 5000 });
    await page.click('input.search-input');

    // Type "tutorial" into the search input
    await page.fill('input.search-input', 'tutorial');

    // Click the search button
    await page.waitForSelector('button.search-btn', { timeout: 5000 });
    await page.click('button.search-btn');

    // Wait for the results page to load and display video results
    await page.waitForSelector('.video-grid', { timeout: 10000 });

    // Take a screenshot of the results page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_results_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_results_page.png'));

    // Extract data to verify that video results are displayed
    const videosPresent = await page.evaluate(() => {
      return document.querySelectorAll('.video-grid .video-item').length > 0;
    });

    return {
      success: true,
      action: "Successfully searched for 'tutorial' and verified video results are displayed.",
      extractedData: { videosPresent },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

